  [],\n\t\"revision_timestamp\": \"2016-05-10T13:22:06.097753\",\n\t\"name\": \"gis-dataset-viewer\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The GIS Datset Viewer can be used to identify
  aerial imagery from the following programs: NAIP (2002-present), NAPP (1987-2006),
  NHAP (1980-1987), AHAP (1976-1986), FSA/NRCS/Other Coverage (1955-1993). Photo center
  point data is available for the previously mentioned imagery programs. Center point
  information includes roll, spot number, exposure number, latitude, longitude, station,
  and exposure date. Center point data is scale dependent and does not display at
  large scales. One way to display the center points is to use the find address or
  place box in the upper right hand corner of the map. Zoom to the area of interest
  and then turn on the center point layer of interest. If the area of interest is
  too large to display the center point layer zoom in until the points appear. Quarter
  Quad coverage information is available for the NAIP imagery program. To view this
  coverage display the map contents and turn on the NAIP QQ coverage layer, expand
  the layer, and then turn on the year of interest.\",\n\t\"license_title\": \"Creative
